B.KE=A.a(s(["Bei gro\xdfen Kanall\xe4ngen sperrt der im Beispiel gezeigte Transistor, da die Spannung UGS (0,6V) unter der Einsatzspannung Uth (0,85V) liegt. In der B\xe4nderdiagrammdarstellung erkennt man dies an der Potenzialbarriere zwischen Source (S) und Bulk (B), die so hoch ist, dass dar\xfcber keine Elektronen von der Source zur Drainelektrode (D) gelangen k\xf6nnen.","Bei Kanall\xe4ngen kleiner 0,75um wird der geometrische Abstand zwischen Source (S) und Drain (D) so gering, dass sich die Potenzialbarriere - und damit auch die Einsatzspannung Uth - verringert. Bei L=0,25um ist die Einsatzspannung so niedrig (0,53V), dass bereits die angelegte Gate-Source Spannung von 0,6V ausreicht, um Elektronen \xfcber die Barriere zur Drain-Elektrode gelangen zu lassen. Bei Transistoren mit kurzer Kanall\xe4nge nimmt die Einsatzspannung daher mit kleiner werdender Kanall\xe4nge ab."]),t.s)
